import "../index.css";
const Contents = (props) => {
  return (
    <div>
      <div className="mid">
        <img src={props.contents.image} alt="Todo" />
      </div>
      <br />
      <div>
        <h2>{props.contents.title}</h2>

        <p>{props.contents.description}</p>
      </div>
    </div>
  );
};
export default Contents;
